import Main from '../Page/Main'
import { Route, Routes } from 'react-router-dom'

const Body = () => {
  return (
    <div>
        <Routes>
            <Route path='/' element={<Main />} />
            {/* <Route path='/login' element={<Login />} /> */}
        </Routes>
    </div>
  )
}

export default Body
